// Title: Navbar.js
// Author: Joel Harawa
// Purpose: Implement Navbar for users on the website

import styled from "styled-components";

const Navbar = () => {
    return (
        <Container>
            <Logo>Moosic</Logo>
        </Container>
    )
}

const Container = styled.div`
    background-color: #1E1E1E;
    display: flex;
    height: 10%;
`;

const Logo = styled.a`
    color: #A402BF;
    font-size: 2em;
`;

export default Navbar;
